import axios from "axios";

function getRandomUsers() {
 return axios 
 .get("https://randomuser.me/api/?results=10")
 .then(res => {
     const users = res.data.results;
     return users.map(user =>{
         return {
             firstName: user.name.first
         }
     })
 })

}
